import React, { useCallback, useState, useEffect } from "react";
import { Container, Grid, makeStyles } from "@material-ui/core";
import Page from "src/components/Page";
// import CustomerActivity from "./CustomerActivity";
import EarningsSegmentation from "./EarningsSegmentation";
import FinancialStats from "./FinancialStats";
import Header from "./Header";
import LatestOrders from "./LatestOrders";
import axios from "src/utils/axios";
import Axios from "axios";
import useIsMountedRef from "src/hooks/useIsMountedRef";
import Overview from "./Overview";

import RoiPerCustomer from "./RoiPerCustomer";

const useStyles = makeStyles((theme) => ({
	root: {
		backgroundColor: theme.palette.background.dark,
		minHeight: "100%",
		paddingTop: theme.spacing(3),
		paddingBottom: theme.spacing(3),
	},
	container: {
		[theme.breakpoints.up("lg")]: {
			paddingLeft: 64,
			paddingRight: 64,
		},
	},
}));

function Records() {
	const classes = useStyles();
	const isMountedRef = useIsMountedRef();
	// const [organizations, setOrganizations] = useState([]);
	const [organization, setOrganization] = useState([]);
	const [documents, setDocuments] = useState([]);

	const getOrganization = useCallback(async () => {
		await Axios.get("http://localhost:3100/organization/4578").then((response) => {
			if (isMountedRef.current) {
				// console.log(0, response.data.organization);
				setOrganization(response.data.organization);
			}
		});
	}, [isMountedRef]);

	const getDocuments = useCallback(async () => {
		await Axios.get("http://localhost:4000/4_0_0/Composition/$documents/113610").then(async (response) => {
			if (isMountedRef.current) {
				// console.log(response.data);
				const documents = response.data;
				// console.log(documents);
				for (let i = 0; i < documents.length; i++) {
					// console.log(document.id);
					var data = {
						documentID: document[i].id,
						userID: "113610",
						organizationID: "4578",
					};
					const phr_server = `http://localhost:3100/document`;
					const phr_config = {
						method: "post",
						url: phr_server,
						data: data,
					};
					await Axios(phr_config)
						.then((phr_response) => {
							if (phr_response) {
								console.log(0, phr_response.data);
							} else {
								console.log(1, "no data");
							}
						})
						.catch((err) => {
							console.log("없음");
						});
				}
				setDocuments(response.data);
			}
		});
	}, [isMountedRef]);

	useEffect(() => {
		getOrganization();
		getDocuments();
	}, [getOrganization, getDocuments]);

	// console.log(1, organization);

	return (
		<Page className={classes.root} title="Dashboard Alternative">
			<Container maxWidth={false} className={classes.container}>
				<Header />
				<Grid container spacing={3}>
					<Grid item key={organization.id} lg={3} sm={6} xs={12}>
						<Overview count={documents.length} name={organization.title} />
					</Grid>

					<Grid item lg={3} sm={6} xs={12}>
						<RoiPerCustomer />
					</Grid>

					<Grid item lg={8} xl={9} xs={12}>
						<FinancialStats />
					</Grid>
					<Grid item lg={4} xl={3} xs={12}>
						<EarningsSegmentation />
					</Grid>
					<Grid item lg={8} xs={12}>
						<LatestOrders />
					</Grid>
					{/* <Grid item lg={4} xs={12}>
						<CustomerActivity />
					</Grid>
					<Grid item lg={8} xs={12}>
						<MostProfitableProducts />
					</Grid>
					<Grid item lg={4} xs={12}>
						<TopReferrals />
					</Grid> */}
				</Grid>
			</Container>
		</Page>
	);
}

export default Records;
